CREATE TABLE `users` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'unique identifier for each user in the system\n',
  `uname` varchar(50) NOT NULL COMMENT 'username of the user',
  `pass` varchar(22) NOT NULL COMMENT 'password of the user',
  `email` varchar(100) NOT NULL COMMENT 'email binded to account',
  `level_of_access_id` int NOT NULL COMMENT 'foreign key to level of access table\n',
  `fname` varchar(45) NOT NULL COMMENT 'first name of user',
  `lname` varchar(45) NOT NULL COMMENT 'last name of user',
  `account_status_id` int NOT NULL COMMENT 'foreign key to account status table',
  `unique_question_id` int NOT NULL COMMENT 'foreign key to unique questions table',
  `unique_question_answer` varchar(45) NOT NULL COMMENT 'answer of user to assigned unique question',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_UNIQUE` (`id`),
  UNIQUE KEY `uname_UNIQUE` (`uname`),
  UNIQUE KEY `email_UNIQUE` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb3;
